import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="bg-clippersBlue text-clippersWhite p-4 flex justify-between">
    <h1 className="text-xl font-bold">LA Clippers Showcase</h1>
    <div className="space-x-4">
      <Link to="/" className="hover:underline">Home</Link>
      <Link to="/team" className="hover:underline">Team</Link>
      <Link to="/league" className="hover:underline">League</Link>
    </div>
  </nav>
);

export default Navbar;
